window.bookSummaryJSON = "<p><b>I don't want an alpha.</b></p> <p>I don't want the legendary Murphy pack as stepbrothers. I don't want to share a house with the four boys every girl in school wants. And I definitely don't want their breath on my skin, their scent in my nose, their marks on my neck.</p> <p>Their father told them to look after me. But he doesn't realize just how they've decided to twist that directive. I'm a pet omega for them to play with. And they're about to give me everything they decide I need.</p>"; 
